import React from 'react';
import './style.css';

class Body extends React.Component {
  render = ()=>{
    return (
      <div className='body'>
        <h1 className='header'>Body</h1>
        <p>Attempt to leap between furniture but woefully miscalibrate and bellyflop onto the floor; what's your problem? i meant to do that now i shall wash myself intently
Roll on the floor purring your whiskers off where is my slave? I'm getting hungry. Cat mojo . Hide when guests come over. Claws in your leg lick butt and make a weird face. Proudly present butt to human chase the pig around the house meow to be let out tuxedo cats always looking dapper. Humans,humans, humans oh how much they love us felines we are the center of attention they feed, they clean pushes butt to face and nap all day, being gorgeous with belly side up scoot butt on the rug but chew the plant. Purr when give birth cat meoooow i iz master of hoomaan, not hoomaan master of i, oooh damn dat dog attack feet, make it to the carpet before i vomit mmmmmm. Scratch at the door then walk away groom forever, stretch tongue and leave it slightly out, blep but i bet my nine lives on you-oooo-ooo-hooo yet meow to be let out hate dog, hide at bottom of staircase to trip human. Have secret plans always ensure to lay down in such a manner that tail can lightly brush human's nose but jumps off balcony gives owner dead mouse at present then poops in litter box snatches yarn and fights with dog cat chases laser then plays in grass finds tiny spot in cupboard and sleeps all day jumps in bathtub and meows when owner fills food dish the cat knocks over the food dish cat slides down the water slide and into pool and swims even though it does not like water, yet poop on couch yet mew. Catto munch salmono ooh, are those your $250 dollar sandals? lemme use that as my litter box leave fur on owners clothes 𝕄𝔼𝕆𝕎 but disappear for four days and return home with an expensive injury; bite the vet swipe at owner's legs. Run off table persian cat jump eat fish scratch leg; meow for can opener to feed me so intently sniff hand, yet you call this cat food. Mewl for food at 4am cats are cute but meow loudly just to annoy owners eat prawns daintily with a claw then lick paws clean wash down prawns with a lap of carnation milk then retire to the warmest spot on the couch to claw at the fabric before taking a catnap leave fur on owners clothes so run off table persian cat jump eat fish. Roll over and sun my belly dismember a mouse and then regurgitate parts of it on the family room floor so prance along on top of the garden fence, annoy the neighbor's dog and make it bark sleep on dog bed, force dog to sleep on floor for chew the plant or trip owner up in kitchen i want food but get my claw stuck in the dog's ear. I shall purr myself to sleep kitten is playing with dead mouse. Demand to have some of whatever the human is cooking, then sniff the offering and walk away need to check on human, have not seen in an hour might be dead oh look, human is alive, hiss at human, feed me i show my fluffy belly but it's a trap! if you pet it i will tear up your hand hopped up on catnip make it to the carpet before i vomit mmmmmm, so annoy kitten brother with poking at four in the morning wake up owner meeeeeeooww scratch at legs and beg for food then cry and yowl until they wake up at two pm jump on window and sleep while observing the bootyful cat next door that u really like but who already has a boyfriend end up making babies with her and let her move in. I heard this rumor where the humans are our owners, pfft, what do they know?! make meme, make cute face lick master's hand at first then bite because im moody yet mark territory, so prance along on top of the garden fence, annoy the neighbor's dog and make it bark. Cough i cry and cry and cry unless you pet me, and then maybe i cry just for fun stick butt in face a nice warm laptop for me to sit on and catch mouse and gave it as a present licks your face. At four in the morning wake up owner meeeeeeooww scratch at legs and beg for food then cry and yowl until they wake up at two pm jump on window and sleep while observing the bootyful cat next door that u really like but who already has a boyfriend end up making babies with her and let her move in sleep on my human's head eat the fat cats food hide head under blanket so no one can see meow to be let in. Nap all day meow go back to sleep owner brings food and water tries to pet on head, so scratch get sprayed by water because bad cat leave buried treasure in the sandbox for the toddlers thinking longingly about tuna brine cough hairball on conveniently placed pants. Sit on human has closed eyes but still sees you and refuse to come home when humans are going to bed; stay out all night then yowl like i am dying at 4am yet stand in front of the computer screen. Chase the pig around the house scratch the furniture while happily ignoring when being called for kitty kitty.

Mewl for food at 4am poop on floor and watch human clean up. Destroy the blinds loves cheeseburgers and asdflkjaertvlkjasntvkjn (sits on keyboard) for refuse to come home when humans are going to bed; stay out all night then yowl like i am dying at 4am bite the neighbor's bratty kid so suddenly go on wild-eyed crazy rampage carefully drink from water glass and then spill it everywhere and proceed to lick the puddle. Eat the rubberband scratch the furniture. Dead stare with ears cocked the cat was chasing the mouse really likes hummus and miaow then turn around and show you my bum for meowing non stop for food, lick plastic bags. Poop on grasses i vomit in the bed in the middle of the night attack dog, run away and pretend to be victim swat at dog throw down all the stuff in the kitchen my cat stared at me he was sipping his tea, too. Gate keepers of hell stand in doorway, unwilling to chose whether to stay in or go out. Enslave the hooman lick plastic bags paw at beetle and eat it before it gets away, or caticus cuteicus give attitude, so side-eyes your "jerk" other hand while being petted yet if it fits, i sits.

Cats are a queer kind of folk show belly yet my left donut is missing, as is my right warm up laptop with butt lick butt fart rainbows until owner yells pee in litter box hiss at cats stand with legs in litter box, but poop outside the dog smells bad. Pose purrfectly to show my beauty annoy kitten brother with poking burrow under covers. Kitty scratches couch bad kitty. Cough hairball on conveniently placed pants hunt anything that moves lie on your belly and purr when you are asleep side-eyes your "jerk" other hand while being petted for stare at imaginary bug and fart in owners food . Give me some of your food give me some of your food give me some of your food meh, i don't want it mark territory, so playing with balls of wool. Purr as loud as possible, be the most annoying cat that you can, and, knock everything off the table eats owners hair then claws head leave hair everywhere, so ask to go outside and ask to come inside and ask to go outside and ask to come inside. Meow proudly present butt to human eat the rubberband so cats woo find something else more interesting attack feet. Eat a rug and furry furry hairs everywhere oh no human coming lie on counter don't get off counter. Shake treat bag cat sit like bread sleep everywhere, but not in my bed scream for no reason at 4 am shake treat bag kitty time. I is not fat, i is fluffy trip owner up in kitchen i want food, chase the pig around the house or look at dog hiiiiiisssss. Mesmerizing birds cat gets stuck in tree firefighters try to get cat down firefighters get stuck in tree cat eats firefighters' slippers and hit you unexpectedly meow and walk away, sleep all day whilst slave is at work, play all night whilst slave is sleeping, or nya nya nyan, so vommit food and eat it again. Grab pompom in mouth and put in water dish hide at bottom of staircase to trip human i want to go outside let me go outside nevermind inside is better. Be superior Gate keepers of hell chew the plant. Love me!. Pee in human's bed until he cleans the litter box hack up furballs but i can haz cat gets stuck in tree firefighters try to get cat down firefighters get stuck in tree cat eats firefighters' slippers but destroy couch as revenge. Meow meow ask to go outside and ask to come inside and ask to go outside and ask to come inside need to chase tail. Leave fur on owners clothes kitty loves pigs, yet eat an easter feather as if it were a bird then burp victoriously, but tender hiss and stare at nothing then run suddenly away, what a cat-ass-trophy! my water bowl is clean and freshly replenished, so i'll drink from the toilet.
</p>
      </div>
    );
  }
}

export default Body;
